// client/src/components/AlternateAirports.jsx
import React, { useEffect, useState } from 'react';
import axios from 'axios';

export default function AlternateAirports() {
  const [data, setData]   = useState([]);
  const [error, setError] = useState(null);

  const load = () => {
    axios.get('/api/alternate_airports')
      .then(r => { setData(r.data); setError(null); })
      .catch(e => setError(e.response?.data?.error || e.message));
  };

  useEffect(load, []);

  return (
    <div className="p-4">
      <h2 className="text-2xl font-semibold mb-4">Alternate Airports</h2>
      <button
        onClick={load}
        className="mb-4 px-4 py-2 bg-green-600 hover:bg-green-700 text-white rounded"
      >
        ðŸ”„ Refresh
      </button>
      {error && <p className="text-red-600 mb-4">Error: {error}</p>}

      <div className="overflow-x-auto">
        <table className="min-w-full bg-white shadow rounded-lg">
          <thead>
            <tr className="bg-gray-100">
              <th className="px-4 py-2 border">City</th>
              <th className="px-4 py-2 border">State</th>
              <th className="px-4 py-2 border">Country</th>
              <th className="px-4 py-2 border"># Airports</th>
              <th className="px-4 py-2 border">Codes</th>
              <th className="px-4 py-2 border">Names</th>
            </tr>
          </thead>
          <tbody>
            {data.map((a, i) => (
              <tr
                key={i}
                className={i % 2 === 0 ? 'bg-white hover:bg-gray-50' : 'bg-gray-50 hover:bg-gray-100'}
              >
                <td className="px-4 py-2 border">{a.city}</td>
                <td className="px-4 py-2 border">{a.state || ''}</td>
                <td className="px-4 py-2 border">{a.country}</td>
                <td className="px-4 py-2 border">{a.num_airports}</td>
                <td className="px-4 py-2 border">{a.airport_code_list}</td>
                <td className="px-4 py-2 border">{a.airport_names_list}</td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    </div>
  );
}
